import React from 'react';
import { ReadingScreen } from '../used/ReadingScreen';
import ResizableContainer from './ResizableContainer';
import { View } from 'react-native';
import {Dimensions} from 'react-native';
function ResizableTab() {
  const numberText = 2;
  return <View>
    <ResizableContainer >
      <ReadingScreen />
    </ResizableContainer>
    <ResizableContainer canExpand={false} initalHeigth={Dimensions.get('window').height/numberText}>
      <ReadingScreen />
    </ResizableContainer>
  </View>;
}

export { ResizableTab };
